import React from "react";

class State extends React.Component{
    constructor(){
        super()
        this.state= {
            name : ""

        }
    }
    namechanged(){
        this.setState({name : this.state.name("Abeer")})

    }
    render(){
        return(
            <div>
                <h2 onClick={this.namechanged}> Hello {this.state.name}</h2>
            </div>
        )
    }
}

export default State
